import react from "react";
import '../node_modules/bootstrap/dist/css/bootstrap.min.css';
import { height } from "@mui/system";


const Services = ()=>{

return(
    <div className="card shadow-lg p-3 mb-5 bg-white rounded" style={{width: "18rem", height : "50%"}}>
    <img className="card-img-top" src="webd.jpg" alt="Card image cap" style={{width:"80%"}}/>
    <div className="card-body">
      <h5 className="card-title">Free Demo</h5>
      <p className="card-text">Get some free demo and share your experience.</p>
      <a href="#" className="btn btn-primary">Go somewhere</a>
    </div>
  </div>
)




}
export default Services;
